import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('#searchInput');
    await page.fill('#searchInput', 'Electronics');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input.png'));

    // Click the search button
    await page.waitForSelector('.search-btn');
    await page.click('.search-btn');
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Click on the first product
    await page.waitForSelector('.product-card');
    await page.click('.product-card');
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_product_detail.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_product_detail.png'));

    // Add the product to the cart
    await page.waitForSelector('.add-to-cart');
    await page.click('.add-to-cart');
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_added_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_added_to_cart.png'));

    // Proceed to checkout
    await page.waitForSelector('.checkout-btn');
    await page.click('.checkout-btn');
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_checkout.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_checkout.png'));

    return {
      success: true,
      action: "Completed rapid cart manipulation stress test",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
